import React from 'react';
import Item from '../components/Item.js';

const ItemList = props => {
   return (
       <div className = 'List'>
           {props.items.map(items => (
               <Item
                   item = {items}
                   key = {items.created}
               />
           ))}
       </div>
   )
}


export default ItemList;
